import { Carousel, Image, Container } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";
import img1 from "assets/images/fondo3.jpg"
import img2 from "assets/images/fondo4.jpg"
import img3 from "assets/images/fondo5.png"



function Carrusel() {
  return (
    <Container>
    <Carousel>
    <Carousel.Item>
          <div
            style={{
              backgroundImage: `url(${img1})`,
              backgroundSize: "cover",
              backgroundPosition: "center",
              height: "35vw", // Ajusta la altura según tus necesidades
            }}
          />
          <Carousel.Caption>
            <h3>Comienzos de integración a invernadero</h3>
          </Carousel.Caption>
        </Carousel.Item>
        <Carousel.Item>
          <div
            style={{
              backgroundImage: `url(${img2})`,
              backgroundSize: "cover",
              backgroundPosition: "center",
              height: "35vw", // Ajusta la altura según tus necesidades
            }}
          />
          <Carousel.Caption>
            <h3>Forma ejemplificada del invernadero</h3>
          </Carousel.Caption>
        </Carousel.Item>
      <Carousel.Item>
        <Image
          src={img2}
          alt="Forma ejemplificada del invernadero"
          style={{ height: "35vw", width: "100%" }} 
          fluid
        />
        <Carousel.Caption>
          <h3>Forma ejemplificada del invernadero</h3>
        </Carousel.Caption>
      </Carousel.Item>
      <Carousel.Item>
        <Image
          src={img3}
          alt="Comienzos de integración a invernadero"
          style={{ height: "35vw", width: "100%",}} 
          fluid
        />
        <Carousel.Caption>
          <h3>Comienzos de integración a invernadero</h3>
        </Carousel.Caption>
      </Carousel.Item>
    </Carousel>
  </Container>
  );
};

export default Carrusel;
